import React from "react";
import "./LandingPage.css";
import logo from "../assets/logo-black.png";

const LandingPage = () => {
    return (
        <div className="home">
            <div className="home_left">
                <img className= "home_left--img" width="100" height="100" src= {logo} alt="twiter_home"/>
            </div>
            <div className="home_right">
                <h1 className="home_right--title">Happening Now</h1>
                <h2 className="home_right--subtitle">Join Twitter today</h2>
                <div className="home_riht--auth__buttons">
                    <button>Sign up with Google</button>
                    <button>Sign up with Apple</button>
                    <button>Sign up with Phone or Email</button>
                    <p className="policies">
                        By signing up, you agree to the <a href="#"> Terms of Service</a> and Privacy Policy, including Cookie Use.
                    </p>
                </div>
            </div>
        </div>
    );
};

export default LandingPage;
